pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract NotesList {
    uint public notesCount = 0;
    uint public itemsCount = 0;

    struct Notes {
        uint id;
        string content;
        bool completed;
    }

    struct Item {
        uint id;
        string itemName;
        string serialNumber;
        string description;
        address owner; // Menambah properti untuk menyimpan alamat pemilik
    }

    mapping(uint => Notes) public notes;
    mapping(uint => Item) public items;
    mapping(address => mapping(uint => Item)) public userItems; // Mapping untuk menyimpan item-item milik pengguna

    event ItemAdded(
        uint id,
        string itemName,
        string serialNumber,
        string description
    );

    event LogItemDetails(
        uint indexed id,
        string itemName,
        string serialNumber,
        string description
    );

    event NotesCreated(
        uint id,
        string content,
        bool completed
    );

    event NotesCompleted(
        uint id,
        bool completed
    );

    constructor() public {
        createNotes("Please add some notes");
    }

    function createNotes(string memory _content) public {
        notesCount++;
        notes[notesCount] = Notes(notesCount, _content, false);
        emit NotesCreated(notesCount, _content, false);
    }

    function toggleCompleted(uint _id) public {
        Notes storage _notes = notes[_id];
        _notes.completed = !_notes.completed;
        emit NotesCompleted(_id, _notes.completed);
    }

    function createItem(string memory _itemName, string memory _serialNumber, string memory _description) public {
        itemsCount++;
        items[itemsCount] = Item(itemsCount, _itemName, _serialNumber, _description, msg.sender);
        userItems[msg.sender][itemsCount] = Item(itemsCount, _itemName, _serialNumber, _description, msg.sender);
        emit ItemAdded(itemsCount, _itemName, _serialNumber, _description);
        emit LogItemDetails(itemsCount, _itemName, _serialNumber, _description);
    }

    function editItem(uint _id, string memory _itemName, string memory _serialNumber, string memory _description) public {
        require(msg.sender == items[_id].owner, "Anda tidak memiliki izin untuk mengedit item ini");
        Item storage currentItem = items[_id];
        currentItem.itemName = _itemName;
        currentItem.serialNumber = _serialNumber;
        currentItem.description = _description;
    }

    function deleteItem(uint _id) public {
        require(msg.sender == items[_id].owner, "Anda tidak memiliki izin untuk menghapus item ini");
        delete items[_id];
        delete userItems[msg.sender][_id];
    }

    function getUserItems() public view returns (Item[] memory) {
        uint itemCount = itemsCount;
        Item[] memory result = new Item[](itemCount);
        uint index = 0;
        for (uint i = 1; i <= itemCount; i++) {
            if (userItems[msg.sender][i].id != 0) {
                result[index] = userItems[msg.sender][i];
                index++;
            }
        }
        return result;
    }
}
